import React, { Component } from 'react'
import './index.css'

export default class List extends Component {
  render() {
    return (
      <ul className="todo-main">
<li style={{backgroundColor:"#ddd"}}>
<label>
					<input type="checkbox"  />
					<span>555</span>
				</label>
				<button className="btn btn-danger" style={{display:'none'}}>删除</button>
</li>

      </ul>
    )
  }
}
